def download_and_save_content(url, file_name):
    response = requests.get(url)
    if response.status_code == 200:
        with open(file_name, 'wb') as file:
            file.write(response.content)
            print(f'喵~ 下载并保存成功: {file_name}')
    else:
        print(f'喵~ 下载失败，状态码: {response.status_code}')

